const pathsParams = ref([
  {
    idx: 1,
    increment: false,
  },
  {
    idx: 2,
    increment: false,
  },
  {
    idx: 1,
    increment: true,
  }
])

const updatePathsIdx = () => {
  const paths = pathsParams.value;
  paths.forEach((path) => {
    path.idx = path.increment ? path.idx + 1 : path.idx - 1;
    if (path.idx === 0 || path.idx === 2) {
      path.increment = !path.increment;
    }
  });
  pathsParams.value = paths;
}

const startInterval = () => {
  clearInterval(intervalId);
  intervalId = setInterval(() => {
    updatePathsIdx();
  }, 250);
}

onMounted(() => {
  const volume = AudioManager.getVolume()
  isActive.value = volume > 0
  gsap.set('.path-sound-off', { drawSVG: isActive.value ? "0%" : "100%" })
  startInterval();
})

const toggle = (hoverEvent = false, hovered = true) => {
  AudioManager.playUI("kaizen_hover");
  const active = Howler.volume() > 0

  if (hoverEvent && !active) return

  isActive.value = hoverEvent && !hovered ? !active : active
  initAnim(isActive.value, hoverEvent)

  if (hoverEvent) return
  AudioManager.setMute(isActive.value ? true : false)
}

const mouseenter = () => {
  // setCursor(CursorState.DEFAULT);
  setCursorHover(true);
  isHovered.value = true;
  toggle(true, true)
}

const mouseleave = () => {
  toggle(true, false);
  // resetCursor();
  setCursorHover(false);
  isHovered.value = false;
}

const { state } = useAppState();
const isScene = computed(() => state.value.matches("scene"))
const isLight = computed(() => state.value.matches("scene") || state.value.matches("origami") || state.value.matches("about") || state.value.matches("intro") || state.value.matches("initializing")|| state.value.matches("outro") || state.value.matches("conclusion"))
const isPortail = computed(() => state.value.matches("portail"))

const initAnim = (muted: boolean, hover = false) => {
  muted ? clearInterval(intervalId) : startInterval();
  if (hover) return;
  gsap.to(
    '.path-sound-off', {
    drawSVG: muted ? "100%" : "0%",
    duration: 0.75,
    ease: "quart.out"
  }
  )
}
</script>

