  transition opacity 0.25s ease-out

  &__inner
    position relative
    width 100%
    height 100%
    transition opacity 0.5s $easeQuartOut
    &.holding
      opacity 0

  &--light
    color var(--light)

  &.is-portail
    bottom auto
    top 0
    right 0

  .icon
    position absolute
    top rem(20)
    right rem(20)
    width rem(20)
    height auto

  .sound-off
    position absolute
    top rem(20)
    right rem(20)
    width rem(20)
    height rem(20)

  &.hovered
    opacity 0.7
</style>